import React, { useState } from 'react';
import { useAuth } from '../context/AuthContext';
import { useNavigate } from 'react-router-dom';

const Login = () => {
  const { login, signup } = useAuth();
  const navigate = useNavigate();

  const [activeTab, setActiveTab] = useState('login');
  const [loginData, setLoginData] = useState({ userId: '', password: '' });
  const [signupData, setSignupData] = useState({
    userId: '', name: '', email: '', password: '', confirmPassword: '', role: 'User'
  });
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  const handleLoginChange = (e) => {
    setLoginData({ ...loginData, [e.target.name]: e.target.value });
    setError('');
  };

  const handleSignupChange = (e) => {
    setSignupData({ ...signupData, [e.target.name]: e.target.value });
    setError('');
  };

  const handleLoginSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');
    const result = await login(loginData.userId, loginData.password);
    if (result.success) navigate('/dashboard');
    else setError(result.error);
    setLoading(false);
  };

  const handleSignupSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');
    if (signupData.password !== signupData.confirmPassword) {
      setError('Passwords do not match');
      setLoading(false);
      return;
    }
    const result = await signup(signupData);
    if (result.success) navigate('/dashboard');
    else setError(result.error);
    setLoading(false);
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-gray-50">
      <div className="w-full max-w-md p-8 bg-white rounded-2xl shadow-md">
        <div className="flex mb-6">
          <button className={`flex-1 py-2 ${activeTab==='login'?'font-bold border-b-2 border-blue-600':'text-gray-500'}`} onClick={()=>setActiveTab('login')}>Login</button>
          <button className={`flex-1 py-2 ${activeTab==='signup'?'font-bold border-b-2 border-blue-600':'text-gray-500'}`} onClick={()=>setActiveTab('signup')}>Sign Up</button>
        </div>

        {activeTab==='login' && (
          <form onSubmit={handleLoginSubmit} className="space-y-4">
            <input name="userId" value={loginData.userId} onChange={handleLoginChange} placeholder="User ID" className="w-full px-4 py-2 border rounded" required/>
            <input name="password" value={loginData.password} onChange={handleLoginChange} type="password" placeholder="Password" className="w-full px-4 py-2 border rounded" required/>
            {error && <p className="text-red-600">{error}</p>}
            <button type="submit" disabled={loading} className="w-full py-2 bg-blue-600 text-white rounded">{loading ? 'Logging in...' : 'Login'}</button>
          </form>
        )}

        {activeTab==='signup' && (
          <form onSubmit={handleSignupSubmit} className="space-y-4">
            <input name="userId" value={signupData.userId} onChange={handleSignupChange} placeholder="User ID" className="w-full px-4 py-2 border rounded" required/>
            <input name="name" value={signupData.name} onChange={handleSignupChange} placeholder="Full Name" className="w-full px-4 py-2 border rounded" required/>
            <input name="email" value={signupData.email} onChange={handleSignupChange} placeholder="Email" type="email" className="w-full px-4 py-2 border rounded" required/>
            <input name="password" value={signupData.password} onChange={handleSignupChange} placeholder="Password" type="password" className="w-full px-4 py-2 border rounded" required/>
            <input name="confirmPassword" value={signupData.confirmPassword} onChange={handleSignupChange} placeholder="Confirm Password" type="password" className="w-full px-4 py-2 border rounded" required/>
            <select name="role" value={signupData.role} onChange={handleSignupChange} className="w-full px-4 py-2 border rounded">
              <option value="User">User</option>
              <option value="Manager">Manager</option>
              <option value="Admin">Admin</option>
            </select>
            {error && <p className="text-red-600">{error}</p>}
            <button type="submit" disabled={loading} className="w-full py-2 bg-green-600 text-white rounded">{loading ? 'Signing up...' : 'Sign Up'}</button>
          </form>
        )}
      </div>
    </div>
  );
};

export default Login;
